-- first ver
select date_trunc('day', tx.transaction_date) as day, tx.client_id,
cc.client_name, vs.vendor_name, sum(tx.sms_count) as sms_count,
sum(tx.client_price_total) as price_total, tx.status_code
from transaction_sms as tx
    left join (select client_id, client_name, client_group_id from client) as cc on tx.client_id = cc.client_id
    left join (select vendor_id, message_id from transaction_sms_vendor) as tsv on tsv.message_id = tx.message_id
    left join (select vendor_id, vendor_name from vendor_sms) as vs on tsv.vendor_id = vs.vendor_id
where tx.transaction_date >= '2021-08-29 00:00:00' and tx.transaction_date <= '2021-08-29 23:59:59'
and (cc.client_group_id = 'PCU2006031331' or cc.client_group_id = 'PHA1904111501')
--and tx.client_id = 'C0821071001717'
group by day, tx.client_id, cc.client_name, vs.vendor_name, tx.status_code order by day desc limit 10 offset 0;

-- second ver
select date_trunc('day', tx.transaction_date) as day, tx.client_id, cc.client_name, vs.vendor_name, 
sum(tx.sms_count) as sms_count, sum(tx.client_price_total) as price_total, tx.status_code
from (select message_id, transaction_date, client_id, sms_count, client_price_total, status_code from transaction_sms) as tx
    left join (select client_id, client_name, client_group_id from client) as cc on tx.client_id = cc.client_id
    left join (select vendor_id, message_id from transaction_sms_vendor) as tsv on tsv.message_id = tx.message_id
    left join (select vendor_id, vendor_name from vendor_sms) as vs on tsv.vendor_id = vs.vendor_id
--    left join transaction_sms_vendor tsv on tsv.message_id = tx.message_id 
where tx.transaction_date between '2021-08-29 00:00:00' and '2021-08-29 23:59:59'
and cc.client_group_id in ('PCU2006031331','PHA1904111501')
group by day, tx.client_id, cc.client_name, vs.vendor_name, tx.status_code order by day desc limit 10 offset 0;

-- third ver
select date_trunc('day', txc.transaction_date) as day, txc.client_id, txc.client_name, vs.vendor_name, txc.telecom_id, 
sum(txc.sms_count) as sms_count, sum(txc.client_price_total) as price_total, txc.status_code, tsv.vendor_trx_status
from (select message_id, transaction_date, tx.client_id, telecom_id, sms_count, client_price_total, status_code, client_name, client_group_id 
	from (select message_id, transaction_date, client_id, telecom_id, sms_count, client_price_total, status_code 
	from transaction_sms where transaction_date between '2021-10-22 00:00:00' and '2021-10-22 23:59:59') tx left join (
	select client_id, client_name, client_group_id from client) as cc on tx.client_id = cc.client_id
--	where cc.client_group_id in ('T5520092812948','PHA1904111501')
--		and cc.client_id in ('T5520092812948')
	) as txc
    left join (select vendor_id, message_id, vendor_trx_status from transaction_sms_vendor) as tsv on tsv.message_id = txc.message_id
    left join (select vendor_id, vendor_name from vendor_sms) as vs on tsv.vendor_id = vs.vendor_id
group by day, txc.client_id, txc.client_name, vs.vendor_name, txc.telecom_id, txc.status_code, tsv.vendor_trx_status order by day desc;

-- fourth ver
select date_trunc('day', txc.transaction_date) as day, txc.client_id, txc.client_name, vs.vendor_name, txc.telecom_id, 
sum(txc.sms_count) as sms_count, sum(txc.client_price_total) as price_total, txc.status_code, txc.vendor_trx_status
from (select tx.*, client_name, client_group_id 
	from (select * from summary_trx_sms_vendor where transaction_date between '2022-03-02 00:00:00' and '2021-03-03 23:59:59') tx 
	left join (select client_id, client_name, client_group_id from client) as cc on tx.client_id = cc.client_id
--	where cc.client_group_id in ('T5520092812948','PHA1904111501')
		and cc.client_id in ('IDE22022502205')
	) as txc
    left join (select vendor_id, vendor_name from vendor_sms) as vs on txc.vendor_id = vs.vendor_id
group by day, txc.client_id, txc.client_name, vs.vendor_name, txc.telecom_id, txc.status_code, txc.vendor_trx_status order by day desc;

-- fifth ver
select date_trunc('day', tx.transaction_date) as day, tx.client_id, cc.client_name, vs.vendor_name, tx.telecom_id, 
sum(tx.sms_count) as sms_count, sum(tx.client_price_total) as price_total, tx.status_code, tx.vendor_trx_status
