select trx.message_id, trx.transaction_date, trx.msisdn, trx.message, cnt.country_name, trx.prefix, 
coalesce(tss.final_status, trx.status_code) as status_code, coalesce(stx.description, sts.description) as description, 
trx.receiver_type, clt.client_name, tel.telecom_name, trx.currency, trx.message_encodng, trx.message_length, trx.sms_count, 
trx.client_price_per_unit, trx.client_price_total, trx.client_sender_id, trx.batch_id, trf.previous_balance, trf.usage, 
trf.after_balance 
from transaction_sms as trx 
left join country as cnt on trx.country_code = cnt.country_id 
left join client as clt on trx.client_id = clt.client_id 
left join transaction_status as sts on trx.status_code = sts.status_code 
left join transaction_sms_status as tss on tss.message_id = trx.message_id 
left join transaction_status as stx on tss.final_status = stx.status_code 
left join transaction_sms_financial as trf on trx.message_id = trf.message_id 
left join telecom as tel on tel.telecom_id = trx.telecom_id 
where trx.transaction_date >= '2022-03-02 00:00:00' and trx.transaction_date <= '2022-03-03 23:59:59';

